#include <stdio.h>
#include "server.h"
#include <pthread.h>
#include <SDL2/SDL.h>
#include <time.h>
#include <math.h>
#define RUNNING 1
#define STOP 0

int game_state = 0;
pthread_t sub;
int resource_id = 0;
void* recever(void* connfd) {
    main_loop((int)connfd, msg_handle);
    _exit(0);
}

void start_server(int port) {
    int sock, n;
    int flag = 1;
    struct sockaddr_in servaddr;
    sock = socket(AF_INET, SOCK_STREAM, 0);
    if(sock < 0) {
        print_err("can not create socket ;;");
    }
    memset(&servaddr, 0, sizeof(servaddr));
    servaddr.sin_family = AF_INET;
    servaddr.sin_port = htons(port);
    servaddr.sin_addr.s_addr = htonl(INADDR_ANY);
    if( setsockopt(sock, SOL_SOCKET, SO_REUSEADDR, &flag, 4) == -1) {
        perror("setsockopt");
    }
    if(bind(sock, (struct sockaddr*)&servaddr, sizeof(servaddr)) < 0) {
        perror("bind");
    }
    if(listen(sock,20) < 0) {
        perror("listen");
    }
    while(1) {
        int pid;
        int connfd = accept(sock, NULL, NULL);
        if((pid = fork()) == 0) {
            if((pid = fork()) == 0) {
                alarm(20);
                pthread_create(&sub, NULL, recever, (void *) connfd);
                game_logic();
                _exit(0);
            }
            exit(1);
        }
        wait(0);
    }
}



int main(int argc,char* argv[]) {
	if(argc != 2) {
		print_err("usage: ./server port\n");
	}
    start_server(atoi(argv[1]));
}

void game_init() {
    init_all();
    game_state = RUNNING;
}

unsigned int random_pos(unsigned int up) {
    return (int)(rand()*up)%up;
}

void* update_pos(void* obj) {
    struct game_object* bitmap1 = (struct game_object*)obj;
    while(1) {
        usleep(1000000);
        bitmap1->x = random_pos(640);
        bitmap1->y = random_pos(480);
        bitmap1->is_updated = 0;
        render_all();
    }
}

unsigned char key_queue[0x10];
unsigned int current_end = 0;

unsigned char read_key() {
    unsigned char result = key_queue[0];
    if(current_end > 0) {
        memcpy(key_queue, &key_queue[1], 9);
        current_end--;
    }
    return result;
}

void wait_for_key(unsigned char keycode) {
    while(1) {
        if(read_key() == keycode) {
            break;
        }
        usleep(500000);
    }
}



